function Header() {
  return (
      <header>
          <nav className="header darken-3">
              <div className="nav-wrapper container">
                  <a href="#" className="brand-logo">Films.com</a>
                  <ul id="nav-mobile" className="right hide-on-med-and-down">
                  </ul>
              </div>
          </nav>
      </header>
  );
}

export default Header;
